import React from 'react';
import { View, Text, Image, StyleSheet } from 'react-native';

const img = require("../../../assets/hd.png")

const servOneData = [
    { img1: require("../../../assets/hd.png"),img2: require("../../../assets/hd.png"), tite: "Haircut & Styling" },
    { img: require("../../../assets/hd.png"), tite: "Haircut & Styling" },
    { img: require("../../../assets/hd.png"), tite: "Haircut & Styling" },
    { img: require("../../../assets/hd.png"), tite: "Haircut & Styling" },
    { img: require("../../../assets/hd.png"), tite: "Haircut & Styling" },
]

const ServiceOneMiddle = () => {
    return (
        <View style={styles.s_middle}>
            <View style={styles.s_middle_flex}>
                <View style={styles.s_Box_one}>
                    <Image source={img} style={styles.imgs} />
                    <Text style={styles.cuts}>Haircut & Styling </Text>
                </View>
                <View style={styles.s_Box_two}>
                    <Image source={img} style={styles.imgs} />
                    <Text style={styles.cuts}>Haircut & Styling </Text>
                </View>
            </View>
        </View>
    );
}

const styles = StyleSheet.create({
    s_middle: {
        width: '100vw',
        height: '100vh',
        backgroundColor: "#fff",
        top: 120,
        display: 'inline-block'
    },
    s_middle_flex: {
        width: '80vw',
        height: '100vh',
        justifyContent: 'space-between',
        margin: 'auto',
        top: 20,
    },
    s_Box_one: {
        position: 'absolute',
        width: 120,
        height: 160,
        left: 3,
        top: 0,
        backgroundColor: '#175C4C',
        borderRadius: '20px',
    },

    imgs: {
        position: 'absolute',
        width: 102,
        height: 120,
        left: 15,
        top: 5,
    },

    cuts: {
        position: 'absolute',
        color: "#fff",
        fontSize: 12,
        top: 133,
        left: 12,
    },
    s_Box_two: {
        position: 'absolute',
        width: 120,
        height: 160,
        left: 179,
        top: 0,
        backgroundColor: '#fff',
        borderRadius: '20px',
        boxShadow: 'rgba(0, 0, 0, 0.05) 0px 0px 0px 1px, rgb(209, 213, 219) 0px 0px 0px 1px inset',
    }
})

export default ServiceOneMiddle;
